class Submit extends Component {
  render() {
    return (
      <div class='container' id='infoContainer'>
        <h2 className='dummyText'>Gebäudeübersicht</h2>
        <div class='row'>
          <div class='one-half column'>1/2</div>
          <div class='one-half column'>1/2</div>
        </div>
      </div>
    );
  }
}

export default Submit;
